import React, { Component } from 'react';
import LoginScreen from './components/login/login'
import Dashboard from './components/dashboard/dashboard'
import {Route, BrowserRouter, Redirect} from 'react-router-dom'
import Register from './components/register/register'
import CameraLayout from './components/cameraFeed/cameraLayout'
import NewUserRegistry from './components/registerNewUser/registerUser'
import UnrecognizedLayout from './components/unrecognizedActivity/unrecognizedDashboard'
import DailyLayout from './components/dailyActivity/activityLayout'

class App extends Component {
  render () {
    return (
      <div>
        <BrowserRouter>
            <Redirect to='/login' />
            <Route path="/login" exact component={LoginScreen}/>
            <Route path="/dashboard" component={Dashboard}/>
            <Route path="/register" component={Register} />
            <Route path="/dashboard/unrecognized" component={UnrecognizedLayout} />
            <Route path="/dashboard/daily" component={DailyLayout} />
            <Route path="/dashboard/cameras" component={CameraLayout} />
            <Route path="/dashboard/settings" component={NewUserRegistry} />
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
